const App = () => {
  const course = "Half Stack application development";
  const part1 = "Fundamentals of React";
  const exercices1 = 10;
  const part2 = "Using props to pass data";
  const exercices2 = 7;
  const part3 = "State of component";
  const exercices3 = 14;
  return (
    <>
      <Header course={course} />
      <Content part={part1} exercices={exercices1} />
      <Content part={part2} exercices={exercices2} />
      <Content part={part3} exercices={exercices3} />
      <Total a={exercices1} b={exercices2} c={exercices3} />
    </>
  );
};
export default App;

const Header = (props) => {
  return (
    <>
      <h1>{props.course}</h1>
    </>
  );
};

const Content = (props) => {
  return (
    <>
      <p>
        {props.part} {props.exercices}
      </p>
    </>
  );
};

const Total = (props) => {
  return <p>Number of exercices {props.a + props.b + props.c}</p>;
};
